import React from 'react';
import './App.css';
import Greet from './components/Greet';
import Welcome from './components/welcome';
function App() {
  return (
    <div className="App">
      <Greet name="Tony stark"> 
          Jarvis are you There 
      </Greet>
      <Welcome name="Robert Downey jr." role="Iron Man" />
      <Greet name="Captain" job="you can do this all the day" />
      <Greet name="Thor" ability="You alone can kill Thanos" />
    </div>
  );
}

export default App;
